import React from 'react'
import { Switch, Route } from 'react-router-dom'
import Home from './Home'

class AppRouter extends React.Component {
    constructor() {
        super()
        this.state = {}
    }
    render() {
        return (
            <Switch>
                <Route exact path="/" component={ Home }/>
            </Switch>
        )
    }
}

export default AppRouter
